import React from "react"

let btnNotClicked = false
// let mylabel = "not clicked"
const Table = props => {
  // const [bookingList, setBookingList] = useState([])

  // setBookingList(bookingList.concat(props.values))

  const clickHandle = () => {
    alert("kuku")
    btnNotClicked = true
    // console.log("wer")
    // mylabel = "clicked"
  }

  return (
    <div>
      <h3>Booking List</h3>

      <table>
        <thead>
          <tr>
            <th>FirstName</th>
            <th>LastName</th>
            <th>Email</th>
            <th>Tel Number</th>
            <th>Cover</th>
            <th>Date</th>
            <th>Time</th>
            {/*  */}
            <th>seated</th>
          </tr>
        </thead>

        <tbody>
          {props.bookingList.map(value => {
            return (
              <tr className="rows">
                <td>{value.firstName}</td>
                <td>{value.lastName}</td>
                <td>{value.email}</td>
                <td>{value.telNumber}</td>
                <td>{value.cover}</td>
                <td>{value.date}</td>
                <td>{value.time}</td>
                {/* <input type="checkbox" name="no" defaultChecked={!checked} onChange={() => setChecked(checked)} /> */}

                {/* <label htmlFor="no">not yet</label> */}
                {/* <td>
                  {!btnNotClicked && <h3 onClick={clickHandle}>not seated</h3>}
                  {btnNotClicked && <h3>seated</h3>}
                </td> */}
                <td> {btnNotClicked === false ? <button onClick={clickHandle}>not seated</button> : <button>seated</button>}</td>
              </tr>
            )
          })}
        </tbody>
      </table>
    </div>
  )
}

export default Table
